Description:

India has instructed her menial stepdaughter to take Samantha back to Ms. Veracruz, and act like she has what she wants. Samantha is equipped with a safe word so that it's clear when to make their move. While the unsuspecting Vanessa parades her wealth around in the form of India's best girls, she makes the mistake of taking them back to India's mansion.

Vanessa flaunts her jewels in front of India taunting her, and laying the facts out for her. Vanessa has her own daughter, her last girl, her business, and seemingly the upper hand. India sits in silence, tantalized while savoring the mockery Vanessa is making of herself. Vanessa orders her girls to put on a show for 'Mommy.' While Samantha and Shyla play their roles, India's knowing smirk proves she is getting tired of Vanessa's embarrassing tirade. Vanessa continues to bark all the orders, but India loses her patience when Villain Vanessa gets a bit too high on her horse.

Ms. Summer stands, face to face with Ms. Veracruz and challenges her to exert her control. When Ms. Summer speaks, the cards turn, and Samantha and Shyla take the side of the hand that feeds. India instantly assumes control. Vanessa's words mean nothing any longer, and her subsequent break down leaves her dragged through India's mud, begging to come back to the home she's always been destined for. 

If you don't care for the story, expect a hot lesbian orgy with the four women. Plenty of f2f cunnilingus and fingering. Enjoy!
